import './App.css';
import Hoc from './Hoc';
import { store } from './redux/store';
import { Provider } from 'react-redux';
import {Counter} from './redux/Counter';

function App() {
  return (
    <>
      <Provider store={store}>
          <Counter/>
      </Provider>
    </>
  )
}

export default App;
